    <div>
        <label><b> Sobrenome </b></label>{{ militar.sobrenome}}
    </div>
    <div>
        <label><b> Tipo Sanguíneo </b></label>{{ militar.tipoSanguineo}}
    </div>
    <div>
        <label><b> Patente </b></label>{{ employee.patente}}
    </div>
</div>
